(45,0,"2019-01-21 22:37:13","2019-01-21 22:37:13","<!-- wp:paragraph -->\n<p>That\'s technically all you need to get your LAMP development environment up and running. However, my setup also leverages a few workflow tools. If you\'d like to take full advantage of my setup you\'ll also want to install:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><a href=\"https://nodejs.org/en/\">Node &amp; NPM</a>&nbsp;- Node is a free tool that can run JavaScript outside the context of a web browser.</li><li><a href=\"https://webpack.github.io/\">webpack</a>&nbsp;- Free tool that bundles up multiple files.</li><li><a href=\"http://gulpjs.com/\">Gulp</a>&nbsp;- Free task-runner tool. No longer the cool kid on the block (webpack owns that title now) but I still prefer Gulp for generic task running and non-bundle\'ish tasks.</li></ul>\n<!-- /wp:list -->","Miaowsalot","","publish","closed","closed","","miaowsalot","","","2019-01-21 23:15:56","2019-01-21 23:15:56","",0,"http://gesundheitsuniversum20.local/?post_type=professor&#038;p=45",0,"professor","",0),
